<p></p><p><strong>Ce Ne Diferențiază:</strong></p><ul><li><p>Experiență și Competență</p></li><li><p>Atenție la Detalii</p></li><li><p>Transparență</p></li><li><p>Prețuri Accesibile</p><p></p></li></ul><p><strong>Serviciile Noastre:</strong> Oferim revizii periodice, diagnoză și reparații pentru a menține vehiculul tău în condiții optime. Descoperă cum putem fi partenerul tău de încredere în lumea auto la Service Economic Trade.</p>\"}, \"browsers\": [], \"editor_name\": \"default\", \"is_repeater\": false}, {\"id\": 1705774935186, \"type\": \"a17-block-testimonials\", \"blocks\": {\"testimonials-item\": [{\"id\": 1705774935535, \"type\": \"a17-block-testimonials-item\", \"blocks\": [], \"medias\": [], \"content\": {\"name\": \"Serban Pavlu\", \"title\": \"Experiență excelentă la Service Economic Trade din București!\", \"content\": \"Am avut recent o experiență remarcabilă la Service Economic Trade. Personalul a fost extrem de profesionist și prietenos. Reparațiile au fost efectuate într-un timp record, iar costurile au fost surprinzător de accesibile. Recomand cu încredere acest service tuturor celor în căutare de servicii auto de calitate la prețuri competitive.\"}, \"browsers\": [], \"is_repeater\": true}, {\"id\": 1705774995068, \"type\": \"a17-block-testimonials-item\", \"blocks\": [], \"medias\": [], \"content\": {\"name\": \"Dan Ionescu\", \"title\": \"Calitate și eficiență la Service Economic Trade - București\", \"content\": \"Am fost impresionat de calitatea serviciilor oferite de Service Economic Trade. Echipa lor a diagnosticat și a remediat cu succes problema mașinii mele într-un timp scurt. Prețurile sunt competitive, iar transparența în comunicare a făcut întreaga experiență plăcută. Cu siguranță voi reveni și îi recomand cu încredere!\"}, \"browsers\": [], \"is_repeater\": true}, {\"id\": 1705775362131, \"type\": \"a17-block-testimonials-item\", \"blocks\": [], \"medias\": [], \"content\": {\"name\": \"Ana Maria Popescu, Fondatoare ABC Fashion SRL\", \"title\": \"O experiență remarcabilă cu Service Economic Trade - Partenerul Ideal pentru Afacerea Mea\", \"content\": \"Service Economic Trade a depășit cu mult așteptările noastre în toate aspectele. Echipa lor de experți a demonstrat o cunoaștere profundă a pieței și o abordare proactivă în soluționarea problemelor specifice afacerii noastre. Serviciile lor economice eficiente și personalizate ne-au ajutat să optimizăm costurile.\"}, \"browsers\": [], \"is_repeater\": true}]}, \"medias\": [], \"content\": [], \"browsers\": [], \"editor_name\": \"default\", \"is_repeater\": false}], \"medias\": [], \"public\": false, \"browsers\": [], \"languages\": [{\"label\": \"English\", \"value\": \"en\", \"disabled\": false, \"published\": true, \"shortlabel\": \"EN\"}], \"parent_id\": 0, \"published\": true, \"repeaters\": [], \"cmsSaveType\": \"update\", \"publish_end_date\": null, \"publish_start_date\": null}'),
(31, 2, 1, '2024-01-20 16:34:11', '2024-01-20 16:34:11', '{\"slug\": {\"en\": \"cariera\"}, \"title\": {\"en\": \"Cariera\"}, \"blocks\": [{\"id\": 1705775635944, \"type\": \"a17-block-titlu\", \"blocks\": [], \"medias\": [], \"content\": {\"title\": {\"en\": \"Cariera\"}}, \"browsers\": [], \"editor_name\": \"default\", \"is_repeater\": false}, {\"id\": 7, \"type\": \"a17-block-add_job\", \"blocks\": [], \"medias\": [], \"content\": {\"job\": \"<p><strong>Descriere:</strong></p><p>Căutăm un mecanic auto cu experiență pentru a se alătura echipei noastre dinamice. Responsabilitățile includ diagnosticarea și repararea vehiculelor, efectuarea reviziilor periodice și asigurarea calității înaltelor servicii oferite clienților noștri.</p><p></p><p><strong>Cerințe:</strong></p><ul><li><p>Experiență anterioară într-un rol similar.2Titluaddexpandmore-dots Titlu</p></li><li><p>Cunoștințe solide în domeniul mecanicii auto.</p></li><li><p>Abilități excelente de diagnosticare și rezolvare a problemelor.</p><p></p></li></ul><p><strong>Beneficii:</strong></p><ul><li><p>Pachet salarial competitiv.</p></li><li><p>Mediu de lucru stimulant.</p></li><li><p>Oportunități de dezvoltare profesională.</p></li></ul>\", \"title\": \"Mecanic Auto\"}, \"browsers\": [], \"editor_name\": \"default\", \"is_repeater\": false}, {\"id\": 8, \"type\": \"a17-block-add_job\", \"blocks\": [], \"medias\": [], \"content\": {\"job\": \"<p><strong>Descriere:</strong> </p><p>Căutăm un Tehnician Auto Electrician pasionat și experimentat pentru a se alătura echipei noastre. Veți fi responsabil de diagnosticarea și repararea sistemelor electrice ale vehiculelor, instalarea de accesorii și furnizarea soluțiilor tehnice adecvate. <br></p><p><strong>Cerințe:</strong></p><ul><li><p>Experiență anterioară în domeniul auto electric. </p></li><li><p>Cunoștințe avansate despre sistemele electrice ale vehiculelor. </p></li><li><p>Abilități excelente de rezolvare a problemelor.</p><p></p></li></ul><p><strong>Beneficii:</strong> </p><ul><li><p>Pachet salarial competitiv. </p></li><li><p>Oportunități de formare și dezvoltare continuă. </p></li><li><p>Mediu de lucru colaborativ și inovator.</p></li></ul>\", \"title\": \"Tehnician Auto Electrician\"}, \"browsers\": [], \"editor_name\": \"default\", \"is_repeater\": false}], \"medias\": [], \"public\": false, \"browsers\": [], \"languages\": [{\"label\": \"English\", \"value\": \"en\", \"disabled\": false, \"published\": true, \"shortlabel\": \"EN\"}], \"parent_id\": 0, \"published\": true, \"repeaters\": [], \"cmsSaveType\": \"update\", \"publish_end_date\": null, \"publish_start_date\": null}');

