(1, 1, NULL, '2024-01-20 13:58:47', '2024-01-20 13:58:47', 'en', 1, '10% discount la 2 revizii de ulei', NULL, NULL),
(2, 2, NULL, '2024-01-20 14:01:32', '2024-01-20 14:03:20', 'en', 1, 'Importanța Reviziilor Periodice pentru Sănătatea Vehiculului Tău', NULL, NULL),
(3, 3, NULL, '2024-01-20 14:04:33', '2024-01-20 14:05:00', 'en', 1, 'Secretele Reviziilor Periodice: Sănătatea Mașinii Începe Aici', '<p>Descoperă importanța reviziilor periodice pentru a menține performanța și fiabilitatea vehiculului tău. Vom explora beneficiile reviziilor regulate și modul în care acestea pot preveni problemele costisitoare, contribuind la longevitatea mașinii tale. La Service Economic Trade, avem echipa și expertiza necesară pentru a asigura cea mai bună îngrijire a vehiculului tău.</p>', '<p>Descoperă secretele reviziilor periodice și asigură-ți mașina o îngrijire de încredere la Service Economic Trade.</p>'),
(4, 4, NULL, '2024-01-20 14:05:07', '2024-01-20 14:05:26', 'en', 1, 'Iarna Vine: Cum Să Pregătești Mașina Pentru Frig și Zăpadă', '<p>Află pașii esențiali pentru a pregăti mașina ta pentru iarnă și pentru a face față condițiilor dificile. De la verificarea sistemului de încălzire la alegerea corectă a anvelopelor de iarnă, vom detalia toate aspectele esențiale. La Service Economic Trade, suntem pregătiți să îți oferim sfaturi și servicii pentru ca mașina ta să rămână în siguranță și performantă în sezonul rece.</p>', '<p>Descoperă cum să îți pregătești mașina pentru iarnă la Service Economic Trade.</p>'),
(5, 5, NULL, '2024-01-20 14:06:23', '2024-01-20 14:07:18', 'en', 1, 'Economisește Combustibil: Sfaturi pentru o Conducere Eficientă', '<p>Învăță strategiile și tehnici de conducere care pot reduce consumul de combustibil și îmbunătăți eficiența vehiculului tău. Vom explora sfaturile practice, cum ar fi menținerea unei viteze constante și evitarea accelerărilor bruște, pentru a economisi combustibil și a proteja mediul. La Service Economic Trade, susținem o conducere responsabilă și oferim sfaturi personalizate pentru nevoile vehiculului tău.</p>', '<p>Descoperă cum să economisești combustibil prin tehnici eficiente de conducere la Service Economic Trade.</p>'),
(6, 6, NULL, '2024-01-20 14:07:54', '2024-01-20 14:08:33', 'en', 1, 'Motor Sănătos, Mașină Sănătoasă: Importanța Schimbării Uleiului', '<p>Află de ce schimbarea regulată a uleiului este vitală pentru sănătatea motorului mașinii tale. Vom explora beneficiile acestui proces, cum ar fi reducerea frecării, răcirea motorului și prevenirea uzurii premature. La Service Economic Trade, avem experiența necesară pentru a asigura schimbările de ulei efectuate la standardele cele mai ridicate, menținând astfel performanța și durabilitatea motorului tău.</p>', '<p>Descoperă importanța schimbării regulate a uleiului la Service Economic Trade.</p>'),
(7, 7, NULL, '2024-01-20 14:09:35', '2024-01-20 14:09:54', 'en', 1, 'Frâne Sigure, Drumuri Sigure: Cum Să Îți Menții Sistemul de Frânare în Formă', '<p>Află sfaturi esențiale pentru a menține sistemul de frânare al mașinii tale în stare optimă. Vom detalia semnele de uzură, frecvența recomandată a verificărilor și importanța unei frânări eficiente pentru siguranța ta pe drum. La Service Economic Trade, ne angajăm să menținem sistemul de frânare al mașinii tale în cea mai bună formă posibilă.</p>', '<p>Descoperă cum să îți menții frânele în siguranță la Service Economic Trade.</p>'),
(8, 8, NULL, '2024-01-20 14:11:28', '2024-01-20 14:12:07', 'en', 1, 'Cum Să Alegi Anvelopele Potrivite pentru Mașina Ta', '<p>Alegerea corectă a anvelopelor este esențială pentru siguranța și performanța mașinii tale. Vom discuta despre tipurile de anvelope, indicatoarele de uzură și cum să alegi dimensiunile potrivite pentru a face față condițiilor de drum specifice. La Service Economic Trade, suntem aici pentru a oferi consultanță și servicii profesionale pentru a te ajuta să alegi cele mai potrivite anvelope pentru vehiculul tău.</p>', '<p>Află cum să alegi anvelopele potrivite la Service Economic Trade.</p>'),
(9, 9, NULL, '2024-01-20 14:12:52', '2024-01-20 14:13:09', 'en', 1, 'Sisteme de Suspensie: Semne că Ar Fi Timpul pentru O Verificare', '<p>Sistemele de suspensie influențează confortul, manevrabilitatea și siguranța mașinii tale. Vom explora semnele că suspensia ar putea avea probleme, cum ar fi zgomotele ciudate sau instabilitatea în timpul conducerii. La Service Economic Trade, oferim verificări detaliate ale sistemului de suspensie și soluții pentru a menține vehiculul tău în condiții optime.</p>', '<p>Află cum să identifici problemele cu sistemul de suspensie la Service Economic Trade.</p>'),
(10, 10, NULL, '2024-01-20 14:13:38', '2024-01-20 14:14:05', 'en', 1, 'Tehnologii Avansate în Diagnoza Auto: Ce Ar Trebui Să Știi', '<p>Descoperă ultimele tehnologii și instrumente de diagnoză auto care asistă tehnicienii în identificarea rapidă a problemelor. Vom explora avantajele echipamentelor moderne și cum acestea contribuie la diagnosticarea precisă. La Service Economic Trade, investim în tehnologie pentru a oferi servicii de înaltă calitate.</p>', '<p>Explorează tehnologiile avansate de diagnoză auto la Service Economic Trade.</p>'),
(11, 11, NULL, '2024-01-20 14:15:01', '2024-01-20 14:15:40', 'en', 1, 'Spălarea Auto Corectă: Sfaturi și Trucuri pentru Un Aspect Impecabil', '<p>Oferim sfaturi detaliate pentru spălarea și detalierea corectă a vehiculului tău, inclusiv alegeri de produse, metode de curățare și atenție la detalii. Vom discuta despre modul în care o spălare auto corectă poate prelungi viața vopselei și îmbunătăți aspectul general al mașinii tale. La Service Economic Trade, ne preocupăm de fiecare detaliu.</p>', '<p>Descoperă cum să speli mașina corect la Service Economic Trade.</p>'),
(12, 12, NULL, '2024-01-20 14:16:14', '2024-01-20 14:21:19', 'en', 1, 'Când Să Schimbi Filtrele Auto: Un Ghid Detaliat', '<p>Filtrele auto reprezintă componente esențiale pentru funcționarea optimă a vehiculului tău. În acest ghid detaliat, vom explora diferitele tipuri de filtre și vom oferi informații valoroase cu privire la momentele potrivite pentru schimbarea lor, asigurând astfel performanța și eficiența durabilă a mașinii tale.</p><p></p><ol><li><p><strong>Filtrul de Ulei:</strong> Filtrele de ulei joacă un rol crucial în protejarea motorului împotriva particulelor și impurităților. Recomandăm schimbarea acestui filtru la fiecare 5.000 - 7.500 de mile sau conform instrucțiunilor specificate în manualul vehiculului tău.</p></li><li><p><strong>Filtrul de Aer:</strong> Aerul curat este esențial pentru combustia eficientă în motor. Schimbarea filtrului de aer la intervale regulate (aproximativ 12.000 - 15.000 de mile) ajută la menținerea unui amestec adecvat de combustibil și aer, îmbunătățind performanța și economia de combustibil.</p></li><li><p><strong>Filtrul de Combustibil:</strong> Filtrul de combustibil împiedică impuritățile să ajungă la sistemul de alimentare. Acesta ar trebui să fie schimbat în mod regulat, în general la fiecare 20.000 - 30.000 de mile sau conform recomandărilor producătorului.</p></li><li><p><strong>Filtrul de Cabină:</strong> Filtrul de cabină asigură un aer curat în interiorul mașinii, filtrând particulele și alergenii. Recomandăm schimbarea acestui filtru la fiecare 15.000 - 25.000 de mile sau conform cerințelor vehiculului tău.</p></li><li><p><strong>Semne Că Filtrele Ar Trebui Schimbate:</strong></p><ul><li><p><strong>Scăderea Performanței:</strong> O scădere bruscă a eficienței mașinii poate indica un filtru de aer sau combustibil înfundat.</p></li><li><p><strong>Zgomote Anormale:</strong> Sunete neobișnuite din motor pot fi cauzate de un filtru de ulei înfundat.</p></li><li><p><strong>Mirosuri Neplăcute:</strong> Un filtru de cabină uzat poate provoca mirosuri neplăcute în interiorul mașinii.</p></li></ul></li><li><p><strong>De Ce Este Importanță Schimbarea Filtrelor la Timp:</strong></p><ul><li><p><strong>Eficiența și Economia de Combustibil:</strong> Filtrele curate asigură o combustie eficientă, îmbunătățind economia de combustibil.</p></li><li><p><strong>Păstrarea Sănătății Motorului:</strong> Filtrarea adecvată protejează motorul împotriva uzurii premature și a daunelor.</p></li></ul></li><li><p><strong>Cum Poate Service Economic Trade Ajuta:</strong> Echipa noastră de tehnicieni calificați este pregătită să ofere servicii profesionale de schimbare a filtrelor, utilizând produse de înaltă calitate și respectând standardele producătorilor. La Service Economic Trade, ne angajăm să menținem vehiculul tău în stare optimă pentru o experiență de conducere fără probleme.</p><p></p></li></ol><p>Alege Service Economic Trade pentru a beneficia de expertiză și atenție detaliată în schimbarea filtrelor auto, contribuind la prelungirea duratei de viață a mașinii tale și la menținerea performanței optime.</p>', '<p>Descoperă când să schimbi filtrele auto la Service Economic Trade.</p>');

