(4, 1, 'App\\Models\\Echipa', 1, '{\"nume\": \"Rares-Stefan Nemet\", \"functie\": \"Consilier Service\", \"descriere\": \"Expert în automobile: Găsește soluții rapide și eficiente pentru nevoile tale auto.\"}', 'coleg', 'card', 3, 'default'),
(5, 1, 'App\\Models\\Echipa', 2, '{\"nume\": \"Radu Ivascu\", \"functie\": \"Director Service\", \"descriere\": \"Lider dedicat al service-ului auto, ghidând echipe spre excelență și satisfacția clienților.\"}', 'coleg', 'card', 3, 'default'),
(6, 1, 'App\\Models\\Echipa', 3, '{\"nume\": \"Eduard-Alexandru Costache\", \"functie\": \"Mecanic Auto\", \"descriere\": \"Maestru în mecanică auto, reparări precise pentru un drum sigur și eficient.\"}', 'coleg', 'card', 3, 'default'),
(7, 2, 'App\\Models\\Echipa', 2, '{\"job\": \"<p><strong>Descriere:</strong></p><p>Căutăm un mecanic auto cu experiență pentru a se alătura echipei noastre dinamice. Responsabilitățile includ diagnosticarea și repararea vehiculelor, efectuarea reviziilor periodice și asigurarea calității înaltelor servicii oferite clienților noștri.</p><p></p><p><strong>Cerințe:</strong></p><ul><li><p>Experiență anterioară într-un rol similar.2Titluaddexpandmore-dots Titlu</p></li><li><p>Cunoștințe solide în domeniul mecanicii auto.</p></li><li><p>Abilități excelente de diagnosticare și rezolvare a problemelor.</p><p></p></li></ul><p><strong>Beneficii:</strong></p><ul><li><p>Pachet salarial competitiv.</p></li><li><p>Mediu de lucru stimulant.</p></li><li><p>Oportunități de dezvoltare profesională.</p></li></ul>\", \"title\": \"Mecanic Auto\"}', 'add_job', NULL, NULL, 'default'),
(8, 2, 'App\\Models\\Echipa', 3, '{\"job\": \"<p><strong>Descriere:</strong> </p><p>Căutăm un Tehnician Auto Electrician pasionat și experimentat pentru a se alătura echipei noastre. Veți fi responsabil de diagnosticarea și repararea sistemelor electrice ale vehiculelor, instalarea de accesorii și furnizarea soluțiilor tehnice adecvate. <br></p><p><strong>Cerințe:</strong></p><ul><li><p>Experiență anterioară în domeniul auto electric. </p></li><li><p>Cunoștințe avansate despre sistemele electrice ale vehiculelor. </p></li><li><p>Abilități excelente de rezolvare a problemelor.</p><p></p></li></ul><p><strong>Beneficii:</strong> </p><ul><li><p>Pachet salarial competitiv. </p></li><li><p>Oportunități de formare și dezvoltare continuă. </p></li><li><p>Mediu de lucru colaborativ și inovator.</p></li></ul>\", \"title\": \"Tehnician Auto Electrician\"}', 'add_job', NULL, NULL, 'default'),
(9, 3, 'App\\Models\\Echipa', 2, '{\"text\": \"<p>Bun venit la Service Economic Trade, destinația ta de încredere pentru servicii auto în București! Suntem o echipă pasionată de profesioniști, oferind servicii de calitate superioară.</p><p></p><p><strong>Misiunea Noastră:</strong> Devenim partenerul tău de încredere, oferind soluții auto de înaltă calitate și atenție deosebită pentru satisfacția clienților.</p><p></p><p><strong>Ce Ne Diferențiază:</strong></p><ul><li><p>Experiență și Competență</p></li><li><p>Atenție la Detalii</p></li><li><p>Transparență</p></li><li><p>Prețuri Accesibile</p><p></p></li></ul><p><strong>Serviciile Noastre:</strong> Oferim revizii periodice, diagnoză și reparații pentru a menține vehiculul tău în condiții optime. Descoperă cum putem fi partenerul tău de încredere în lumea auto la Service Economic Trade.</p>\"}', 'poza-text', NULL, NULL, 'default'),
(12, 3, 'App\\Models\\Echipa', 1, '{\"title\": {\"en\": \"Despre noi\"}}', 'titlu', NULL, NULL, 'default'),
(13, 4, 'App\\Models\\Echipa', 1, '{}', 'accordion', NULL, NULL, 'default'),
(14, 4, 'App\\Models\\Echipa', 1, '{\"title\": \"Ce tipuri de servicii oferă Service Economic Trade?\", \"content\": \"Oferim o gamă completă de servicii auto, inclusiv revizii periodice, reparații mecanice și electrice, diagnoză computerizată, schimb de ulei, service de frânare, aliniere roți, și multe altele. Echipa noastră experimentată și bine instruită este aici pentru a vă asigura că mașina dumneavoastră beneficiază de îngrijirea optimă.\"}', 'accordion-item', 'accordion-item', 13, 'default'),
(15, 4, 'App\\Models\\Echipa', 2, '{\"title\": \"Care sunt modalitățile de plată acceptate la Service Economic Trade?\", \"content\": \"Acceptăm plăți în numerar, carduri de debit și credit, precum și plăți prin transfer bancar. Asigurăm transparență în ceea ce privește costurile serviciilor noastre și vă vom furniza o estimare detaliată înainte de a începe orice lucrare majoră.\"}', 'accordion-item', 'accordion-item', 13, 'default'),
(16, 1, 'App\\Models\\Contact', 2, '{}', 'contact-form', NULL, NULL, 'default'),
(17, 1, 'App\\Models\\Contact', 1, '{\"title\": {\"en\": \"Contact\"}}', 'titlu', NULL, NULL, 'default'),
(18, 1, 'App\\Models\\Home', 1, '{}', 'carousel', NULL, NULL, 'default'),
(19, 1, 'App\\Models\\Home', 1, '{\"link\": \"/articole/cand-sa-schimbi-filtrele-auto-un-ghid-detaliat\", \"color\": \"white\", \"description\": \"Când Să Schimbi Filtrele Auto\"}', 'carousel-item', 'carousel-item', 18, 'default'),
(20, 1, 'App\\Models\\Home', 2, '{\"link\": \"/articole/cum-sa-alegi-anvelopele-potrivite-pentru-masina-ta\", \"color\": \"white\", \"description\": \"Cum Să Alegi Anvelopele Potrivite pentru Mașina Ta\"}', 'carousel-item', 'carousel-item', 18, 'default'),
(21, 1, 'App\\Models\\Home', 2, '{}', 'flexbox', NULL, NULL, 'default'),
(22, 1, 'App\\Models\\Home', 1, '{\"text\": \"<p>Bine ați venit la Service Economic Trade, locul unde pasiunea pentru automobile se întâlnește cu profesionalismul și experiența. Ne dedicăm să oferim servicii auto de cea mai înaltă calitate pentru a vă menține vehiculul în stare optimă. Cu o experiență vastă și echipamente de ultimă generație, vă garantăm că automobilul dumneavoastră va beneficia de cea mai bună atenție posibilă.<br></p>\"}', 'poza-text', 'card', 21, 'default'),
(23, 1, 'App\\Models\\Home', 2, '{\"text\": \"<p>La Service Economic Trade , avem o echipă de mecanici calificați și experimentați, dedicați să vă ofere cele mai bune servicii. Fiecare membru al echipei noastre este instruit să lucreze cu cele mai recente tehnologii și să rezolve orice problemă cu atenție și profesionalism.</p>\"}', 'poza-text', 'card', 21, 'default'),
