(27, 1, 'App\\Models\\Home', 2, '{\"link\": \"/articole/economiseste-combustibil-sfaturi-pentru-o-conducere-eficienta\", \"description\": \"Sfaturi pentru o Conducere Eficientă\"}', 'card', 'card', 25, 'default'),
(28, 1, 'App\\Models\\Home', 3, '{\"link\": \"/articole/sisteme-de-suspensie-semne-ca-ar-fi-timpul-pentru-o-verificare\", \"description\": \"Sisteme de Suspensie\"}', 'card', 'card', 25, 'default'),
(31, 3, 'App\\Models\\Echipa', 3, '{}', 'testimonials', NULL, NULL, 'default'),
(32, 3, 'App\\Models\\Echipa', 1, '{\"name\": \"Serban Pavlu\", \"title\": \"Experiență excelentă la Service Economic Trade din București!\", \"content\": \"Am avut recent o experiență remarcabilă la Service Economic Trade. Personalul a fost extrem de profesionist și prietenos. Reparațiile au fost efectuate într-un timp record, iar costurile au fost surprinzător de accesibile. Recomand cu încredere acest service tuturor celor în căutare de servicii auto de calitate la prețuri competitive.\"}', 'testimonials-item', 'testimonials-item', 31, 'default'),
(33, 3, 'App\\Models\\Echipa', 2, '{\"name\": \"Dan Ionescu\", \"title\": \"Calitate și eficiență la Service Economic Trade - București\", \"content\": \"Am fost impresionat de calitatea serviciilor oferite de Service Economic Trade. Echipa lor a diagnosticat și a remediat cu succes problema mașinii mele într-un timp scurt. Prețurile sunt competitive, iar transparența în comunicare a făcut întreaga experiență plăcută. Cu siguranță voi reveni și îi recomand cu încredere!\"}', 'testimonials-item', 'testimonials-item', 31, 'default'),
(34, 3, 'App\\Models\\Echipa', 3, '{\"name\": \"Ana Maria Popescu, Fondatoare ABC Fashion SRL\", \"title\": \"O experiență remarcabilă cu Service Economic Trade - Partenerul Ideal pentru Afacerea Mea\", \"content\": \"Service Economic Trade a depășit cu mult așteptările noastre în toate aspectele. Echipa lor de experți a demonstrat o cunoaștere profundă a pieței și o abordare proactivă în soluționarea problemelor specifice afacerii noastre. Serviciile lor economice eficiente și personalizate ne-au ajutat să optimizăm costurile.\"}', 'testimonials-item', 'testimonials-item', 31, 'default'),
